import { StyleSheet } from "react-native";
const css = StyleSheet.create({
    titulo:{
      color:'#ffffff',
      fontSize: 40,
      textAlign : 'center'
    },
    fundo: {
      flex: 1,
      backgroundColor: '#2e2e2e',
    },

    container1:{
      flex:1,
      //backgroundColor: '  ',
      flexDirection: 'row',
      justifyContent: 'center',
      alignItems: 'center'
    },
    button1:{
      backgroundColor:'#084d6e',
      marginRight: 50,
      padding: 30,
      color: '#ffffff'
    },
    button2:{
      marginLeft: 50
    },
    dark_bg:{
      backgroundColor:'#333'
    },
    login__msg:{
      fontWeight: "bold",
      fontSize: 22,
      color:'red',
    }
  });
  export {css};
